import React from 'react';
import styled from 'styled-components';

const Div=styled.div`
  width:60%;
  border:solid 1px #dbdbdb;
`
const MarginDiv=styled.div`
  margin:32px auto;
`
const ProfileDiv=styled.div`
  display:flex;
  margin-left:130px;
`
const ProfileImg=styled.img`
  border-radius:50%;
  width:38px;
  height:38px;
  object-fit:cover;
  margin-right:25px;
`
const ProfileText=styled.div`
  font-size:20px;
  margin-bottom:2px;
  font-weight:bold;
`
const ChangeProfile=styled.div`
  font-size:14px;
  color:#0095f6;
  font-weight:bold;
`
const NameDiv=styled.div`
  display:flex;
  margin-bottom:32px;
`
const Label =styled.div`
  font-size:20px;
  font-weight:bold;
  padding-left:32px;
  padding-right:32px;
  text-align:right;
  flex:0 0 194px;
`
const Input=styled.input`
  flex:0 1 355px;
  width:100%;
  height:32px;
  padding:0 10px;
  border-radius:3px;
  border:solid 1px #dbdbdb;
`
const Text=styled.div`
  width: 100%;
  max-width:355px;
  color:#8e8e8e;
  font-size:12px;
  line-height:16px;
`
const A=styled.a`
  font-size:12px;
  text-decoration:none;
  color:#0095f6;
`
const NickNameDiv=styled.div`
  display:flex;
  margin-bottom:32px;
`
const WebSiteDiv=styled.div`

`
const PrivateDiv=styled.div`

`
const RecommandDiv=styled.div`

`

function Edit() {
  return (
    <Div>
      <MarginDiv>
      <ProfileDiv>
        <ProfileImg src='../images/activeStatus/photo.png'></ProfileImg>
        <div>
        <ProfileText>username</ProfileText>
        <ChangeProfile>프로필 사진 바꾸기</ChangeProfile>
        </div>
      </ProfileDiv>
      <NameDiv>
        <Label>이름</Label>
        <div>
        <Input type='text' value='USER'></Input>
        <Text>사람들이 이름, 별명 또는 비즈니스 이름 등 회원님의 알려진 이름을 사용하여 회원님의 계정을 찾을 수 있도록 도와주세요. <br/><br/> 이름은 14일 안에 두 번만 변경할 수 있습니다.</Text>
        </div>     
      </NameDiv>
      <NickNameDiv>
        <Label>사용자 이름</Label>
        <div>
        <Input type='text' value='nickname'></Input>
        <Text>대부분의 경우 14일 이내에 사용자 이름을 다시 nickname(으)로 변경할 수 있습니다. <A href='https://help.instagram.com/876876079327341' target="_blank">더 알아보기</A></Text>
        </div>
      </NickNameDiv>
      <WebSiteDiv></WebSiteDiv>
      <PrivateDiv></PrivateDiv>
      <RecommandDiv></RecommandDiv>
      </MarginDiv>
    </Div>
  );
}

export default Edit;
